import React, { Component} from 'react';
import $ from 'jquery';
import data from "../data"; 
const Api = ({ type = 'button', handleClick, children }) => {
  return (
    <button type={type} onClick={handleClick}>
      {children}
    </button>
  );
};
export default Api;
